at second 10-12 I hear &quot;telephone&quot; and a fainter &quot;hello?&quot; I&#39;ve gotten one or two &quot;telephone-hello&quot; voices myself.  Very interesting.  

at about second 18 &quot;you&#39;re/its so beautiful&quot; a high soft female voice, I&#39;ve gotten this message before and have also noticed it on others&#39; files too.  These along with the &quot;I love you&quot;s are a good sign to hear, it means whoever is on the other side is feeling happy right now.

around sec 33-35 a man says quickly &quot;I&#39;ve paid a bit cause of you&quot;

sec 42-43 &quot;wait, just come&quot; harmonic/singing higher pitch

sec 44-45 &quot;the people are talking to me&quot; also harmonic/singing higher pitch, I think in response to the message at sec 42-43

sec 46-48 &quot;you must do it&quot;

sec 49-51 &quot;did you say do that?&quot; another high synth voice

at 1:02 there&#39;s the &quot;I love you&quot; :)

there are so many more communications just on your FM sample, but some are too quick/blurry to decipher quickly, but there are definitely way many more!

